var toppe = _top();

var cur_medal_id = 0;

function medal_click(medal_id, obj) {

    toppe.$('#medal_common_dat').html('');
    toppe.$('#medal_common').html('');
    toppe.$('#upgrade_medal_button').show();

    var pos = $(obj).position();

    toppe.$('#medal_title_info').html(medal_info[medal_id]['title']);

    var coor = getIframeShift();

    //toppe.$('#medal_update_info').css('left', pos['left'] + coor.left);
    //toppe.$('#medal_update_info').css('top', pos['top'] + coor.top);

    toppe.$('#medal_update_info').css('left', 'calc(50% - 200px)');
    toppe.$('#medal_update_info').css('top', '2%');

    $.ajax({
        type: 'POST',
        url: "medals.php?&mode=update&update_id=" + medal_id,
        async: false,
        success: function (data) {

        },
        complete: function (data) {
            toppe.$('#medal_common').html(data.responseText);
            cur_medal_id = medal_id;
        },
    });

    toppe.$('#medal_update_info').show();
}

function medal_update() {
    var update_cnt = toppe.$('#update_cnt').val();
    $.ajax({
        type: 'POST',
        url: "medals.php?&action=update_medal&update_id=" + cur_medal_id + "&update_cnt=" + update_cnt,
        async: false,
        success: function (data) {

        },
        complete: function (data) {
            toppe.$('#medal_common_dat').html(data.responseText);
            if (data.responseText.length < 11) {
                $.ajax({
                    type: 'POST',
                    url: "medals.php?&mode=update&update_id=" + cur_medal_id + "&update_cnt=" + update_cnt,
                    async: false,
                    success: function (data) {

                    },
                    complete: function (data) {
                        toppe.$('#medal_common').html(data.responseText);
                    },
                });
            }
        },
    });
}

function medal_alt(medal_id, m_event, evnt) {
    var alt_div = $('#medal_alt');
    var cur_id = alt_div.attr("data-id");

    if (evnt == 2) {
        document.onmousemove = function (e) {
            medal_alt(0, e || event, 1);
        }
        alt_div.show();
    } else if (evnt == 0) {
        document.onmousemove = function () {
        };
        alt_div.hide();
        return false;
    }

    if (evnt == 1) {
        var coor = getIframeShift();
        var ex = m_event.clientX + coor.left;
        var ey = m_event.clientY + coor.top;

        ex = m_event.clientX + document.body.scrollLeft;
        ey = m_event.clientY + document.body.scrollTop;

        var x = ex + alt_div.offsetWidth > document.body.clientWidth - 20 ? ex - alt_div.offsetWidth - 10 : ex + 10;
        var y = ey + alt_div.offsetHeight - document.body.scrollTop > document.body.clientHeight - 20 ? ey - alt_div.offsetHeight - 10 : ey + 10;

        if (x < 0) {
            x = ex - alt_div.offsetWidth / 2;
        }
        if (x < 7) {
            x = 7;
        }
        if (x > document.body.clientWidth - alt_div.offsetWidth - 20) {
            x = document.body.clientWidth - alt_div.offsetWidth - 20;
        }

        alt_div.css('left', x);
        alt_div.css('top', y);
        return false;
    }

    if (cur_id == medal_id) return false;

    alt_div.attr("data-id", medal_id);

    var title = medal_info[medal_id]['title'];
    var description = medal_info[medal_id]['description'];

    var content = '';

    content += '<table width="300" border="0" cellspacing="0" cellpadding="0" style="background-color:#FBD4A4;" class="aa-table">';
    content += '<tr><td width="14" class="aa-tl"><img src="images/d.gif" width="14" height="24"><br></td>';
    content += '<td class="aa-t aa-table-t" align="center" style="vertical-align:middle"><b>' + title + '</b></td>';
    content += '<td width="14" class="aa-tr"><img src="images/d.gif" width="14" height="24"><br></td></tr>';
    content += '<tr><td class="aa-l" style="padding:0;"></td><td style="padding:0;">';
    content += '<table width="275" style=" margin: 3px" border="0" cellspacing="0" cellpadding="0" class="aa-table-t"><tr>';
    content += '<td align="center" valign="top" width="60">';

    content += description;

    content += '</td></tr></table></td><td class="aa-r" style="padding:0px"></td></tr>';
    content += '<tr><td class="aa-bl"></td><td class="aa-b"><img src="images/d.gif" width="1" height="5"></td><td class="aa-br"></td></tr>';
    content += '</table>';

    alt_div.html(content);
}